import React from 'react';
import Navbar from '../../component/Navbar/Navbar'
import Footer from '../../component/Footer/Footer'
import {Input, Space,Layout} from 'antd';
import { AudioOutlined } from '@ant-design/icons';

const { Content } = Layout;
const contentStyle = {
    height:'100vh',
    width:'100%', 
    // backgroundColor:'#0D0311', 
    display:'flex',
    justifyContent:'center',
    flexAlign:'column',
    paddingTop:'8vh'
}

const { Search } = Input;

const suffix = (
  <AudioOutlined
    style={{
      fontSize: 16,
      color: '#1890ff',
    }}
  />
);

const onSearch = value => console.log(value);

class find extends React.Component{
    render() {
        return(
            <Layout>
                <Navbar/>
                <Content style={contentStyle}>
                    <Space direction="vertical" style={{textAlign:'center'}}>
                        <Search
                        placeholder="ENTER NAME/HASHTAG TO FIND YOUR STANDEE"
                        allowClear
                        enterButton="FIND STANDEE"
                        size="large"
                        onSearch={onSearch}
                        allowClear
                        style={{ width: '50vw' }}
                        />
                        or

                        <Button type="primary" shape='round' style={{height:'3rem', fontFamily:'Montserrat', fontWeight:'Bold', color:'#5C082A', backgroundColor:'#F5F1E3'}}>FIND YOUR STANDEE</Button>
                    </Space>
                </Content>
                <Footer/>
            </Layout>
        )
    }
}

export default find
